import "./ExtendedNav.css";

import { CloseButton } from "@mantine/core";
import ExtendedNavLink from "./ExtendedNavLink";
import React from "react";

const ExtendedNav = ({ onClick, loggedin = false }) => {
  return (
    <div className="extended-nav">
      <div className="close-button-container">
        <CloseButton
          size="xl"
          color="dark"
          iconSize={20}
          onClick={onClick}
          className="close-button"
        />
      </div>
      <div className="extended-nav-items">
        <ExtendedNavLink to="/" item="Home" />
        {loggedIn ? (
          <ExtendedNavLink to="/" item="Profile" />
        ) : (
          <ExtendedNavLink to="/" item="About Us" />
        )}
        <ExtendedNavLink to="/" item="Anchor University" />
        <ExtendedNavLink to="/" item="Education" />
        <ExtendedNavLink to="/" item="Entertainment" />
        <ExtendedNavLink to="/" item="Arts and Culture" />
        <ExtendedNavLink to="/" item="Business and Economy" />
        <ExtendedNavLink to="/" item="Editorial" />
        <ExtendedNavLink to="/" item="Fashion" />
        <ExtendedNavLink to="/" item="Feature" />
        <ExtendedNavLink to="/" item="Health" />
        <ExtendedNavLink to="/" item="Opinion" />
        <ExtendedNavLink to="/" item="Science and Technology" />
        <ExtendedNavLink to="/" item="Sport" />
        <ExtendedNavLink to="/" item="Transport" />
      </div>
    </div>
  );
};

export default ExtendedNav;
